public class TRIANGLE {
  public static void triangle(int a, int b, int c) {
    int x, y, z;
    if (a <= b) { // B0
      if (b <= c) { x = a; y = b; z = c;} // B1
      else if (c < a) { x = c; y = a; z = b;} // B2: if (c < a) 
      else { x = a; y = c; z = b;}
    } else {
      if (c > a) { x = b; y = a; z = c;} // B3
      else if (c < b) { x = c; y = b; z = a;} // B4: if(c < b) 
      else { x = b; y = c; z = a;}
    }
    if (x + y <= z) { // B6
      System.out.println("Not a valid triangle");
    } else {
      System.out.println("A valid triangle");
    }
  }
}

